"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Crohn's disease in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/crohns-disease-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H461002861\">",
"      <span class=\"h1\">",
"       What is Crohn's disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Crohn's disease is a disorder that can cause diarrhea, belly pain, and other symptoms that affect the digestive tract. The digestive tract is the part of the body and takes in and breaks down food. It includes the mouth, the stomach, and the intestines (",
"      <a class=\"graphic graphic_figure graphicRef66110 \" href=\"UTD.htm?28/27/29107\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      When it is working normally, the body's immune system kills germs and \"bad\" cells that could turn into cancer. Sometimes, instead of killing only bad cells, something goes wrong and the immune system starts to attack healthy cells. That is called an \"autoimmune response.\" It is what happens in Crohn's disease. If you have Crohn's disease, your body is attacking the lining of the digestive tract. This causes inflammation, which can lead to sores (ulcers) and bleeding.",
"     </p>",
"     <p>",
"      The symptoms of Crohn's disease can get better or worse at different times. But the condition cannot be cured. Luckily, there are medicines and other treatments that can improve its symptoms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H461002868\">",
"      <span class=\"h1\">",
"       What are the symptoms of Crohn's disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common symptoms are diarrhea, belly pain, feeling tired, weight loss, and fever. Some people with Crohn's disease also get mouth sores, skin rashes, joint pain, and eye redness.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H461002875\">",
"      <span class=\"h1\">",
"       Is there a test for Crohn's disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are a few tests that can help diagnose Crohn's disease. Doctors use x-rays or scans to look at the upper intestine and a test called \"colonoscopy\" to look at the lower intestine. During a colonoscopy, the doctor puts a thin tube into your rectum and threads it up into your colon. The tube has a camera attached to it, so the doctor can look inside your colon.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H461002882\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your symptoms might improve if you:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Cut down on foods that make your symptoms worse. Some people have problems with foods that have a lot of fiber, such as fruits and vegetables.",
"       </li>",
"       <li>",
"        Quit smoking, if you smoke. Smoking makes symptoms worse and increases the chances that you will need surgery.",
"       </li>",
"       <li>",
"        Avoid medicines such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sold as Motrin&reg; or Advil&reg;) and",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?43/35/44597?source=see_link\">",
"         naproxen",
"        </a>",
"        (sold as Aleve&reg;)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H461002889\">",
"      <span class=\"h1\">",
"       How is Crohn's disease treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are many different medicines that help reduce the symptoms of Crohn's disease. Almost all of these medicines work by reducing inflammation and the body's immune response. Some medicines treat symptoms when they are at their worst. Other medicines help keep symptoms from starting up or coming back. Doctors sometimes also prescribe antibiotics to people with Crohn's disease.",
"     </p>",
"     <p>",
"      You might have to try a few different medicines before you find the one that works best for you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H461002896\">",
"      <span class=\"h1\">",
"       Is surgery an option?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Surgery is helpful if medicines do not do enough to control your symptoms or if the medicines cause side effects that you can't stand. Surgery does not cure the disease, but it can help you to feel better and return to normal activities. The two most common types of surgery to treat Crohn's disease work by:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Removing of the diseased part of the colon",
"       </li>",
"       <li>",
"        Re-opening parts of the colon that have become blocked",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H106374613\">",
"      <span class=\"h1\">",
"       Does Crohn's disease lead to colon cancer?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It can. Your risk depends on how long you've had it and whether your colon is affected. Experts suggest that people with Crohn's disease that affects the colon get screened early and often. This might mean having a colonoscopy a few years after being diagnosed, and once a year after that.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H461002910\">",
"      <span class=\"h1\">",
"       What will my life be like?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with Crohn's disease often need lifelong treatment. But with treatment, many people with the condition are able to live fairly normal lives.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H461002917\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In most cases, Crohn's disease does not affect a woman's ability to get pregnant. If you want to get pregnant, talk to your doctor or nurse before you start trying to get pregnant. He or she can make sure you get all the tests you need before and during your pregnancy. Plus, your doctor or nurse might want to switch your medicines. That's because some of the medicines used to treat Crohn's disease may not be safe for a baby.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H461002924\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?9/5/9299?source=see_link\">",
"       Patient information: Diarrhea in adults (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?11/38/11875?source=see_link\">",
"       Patient information: Colostomy care (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?37/9/38034?source=see_link\">",
"       Patient information: Colectomy (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?28/55/29554?source=see_link\">",
"       Patient information: Crohn&rsquo;s disease in children (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?23/40/24196?source=see_link\">",
"       Patient information: Crohn's disease (Beyond the Basics)",
"      </a>",
"     </p>",
