var title_f9_56_10124="Vomiting dx studies children";
var content_f9_56_10124=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F54450&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F54450&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical utility of various diagnostic studies in the diagnosis of vomiting in a child",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Name of study",
"       </td>",
"       <td class=\"subtitle1\">",
"        Utility",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Complete blood count",
"       </td>",
"       <td>",
"        Anemia and iron deficiency may be associated with obstruction, IBD, gastritis and ulcer disease;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated white blood cell count are associated with bacterial infections and sepsis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Electrolytes, BUN/Creatinine",
"       </td>",
"       <td>",
"        Electrolyte abnormalities are associated with pyloric stenosis, adrenal insufficiency, and metabolic diseases.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated BUN/Creatinine are seen in renal disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Blood chemistry",
"       </td>",
"       <td>",
"        Elevated AST, ALT, total bilirubin, and GGT are seen in liver and gallbladder disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Amylase, lipase",
"       </td>",
"       <td>",
"        Elevated in pancreatitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Plain radiograph of the abdomen",
"       </td>",
"       <td>",
"        Rule out obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Upper gastrointestinal series",
"       </td>",
"       <td>",
"        Rule out anatomic abnormality of upper GI tract",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CT of the head",
"       </td>",
"       <td>",
"        Rule out intracranial mass",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abdominal ultrasound",
"       </td>",
"       <td>",
"        Rule out pyloric stenosis; evaluation of liver, gallbladder, and pancreas; diagnosis of intussusception.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Radionucleotide gastric emptying study",
"       </td>",
"       <td>",
"        Evaluate for gastroparesis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Endoscopy",
"       </td>",
"       <td>",
"        Rule out intestinal inflammation; able to obtain cultures for H. pylori, CMV, and Giardia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IBD: inflammatory bowel disease; BUN: blood urea nitrogen; AST: aspartate aminotransferase; ALT: alanine aminotransferase; GGT: gamma-glutamyl transpeptidase; GI: gastrointestinal; CT: computerized tomography; CMV: cytomegalovirus.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
