"        </span>",
"       </td>",
"       <td class=\"subtitle1\">",
"        Maintenance hemodialysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Protein",
"       </td>",
"       <td>",
"        0.8 to 1.0 g/kg/day&Delta; of high biological value protein",
"       </td>",
"       <td>",
"        &gt;1.2 to 1.3 g/kg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Energy",
"       </td>",
"       <td colspan=\"2\">",
"        &ge;35 kcal/kg/day; if the body weight is greater than 120 percent of normal or the patient is greater than 60 years of age a lower amount may be prescribed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fat, percent of total energy intake",
"       </td>",
"       <td>",
"        30 to 40",
"       </td>",
"       <td>",
"        30 to 40",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Polyunsaturated-to-saturated ratio (fatty acid ratio)",
"       </td>",
"       <td>",
"        1.0:1.0",
"       </td>",
"       <td>",
"        1.0:1.0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Carbohydrate",
"       </td>",
"       <td colspan=\"2\">",
