"        Minerals, range of intake",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Sodium, mg/day",
"       </td>",
"       <td class=\"sublist_other\">",
"        &lt;2000",
"       </td>",
"       <td class=\"sublist_other\">",
"        &lt;2000",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Potassium, meq/day",
"       </td>",
"       <td class=\"sublist_other\">",
"        40 to 70",
"       </td>",
"       <td class=\"sublist_other\">",
"        40 to 70",
"       </td>",
