"       <td class=\"sublist_other\">",
"        1400 to 1600",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Magnesium, mg/day",
"       </td>",
"       <td class=\"sublist_other\">",
"        200 to 300",
"       </td>",
"       <td class=\"sublist_other\">",
"        200 to 300",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Iron, mg/day",
"       </td>",
"       <td class=\"sublist_other\">",
"        &ge;10 to 18&sect;",
