"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The nutritional intake is adjusted based upon individual needs. This is particularly important for the carbohydrate, lipid, and mineral contents of the diet.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      GFR &lt;70 mL/min/1.73 m2 with evidence for progression.",
"      <br>",
"       &Delta; Some recommend 0.56 to 0.75 g/kg/day, with 0.35 g/kg/day of high biological value protein. The protein intake is increased by 1.0 g/day of high biological value protein for each gram per day of urinary protein loss. This is performed under close supervision and dietary counseling.",
"       <br>",
"        <span class=\"lozenge\">",
"         &loz;",
"        </span>",
"        Phosphate binders often are also needed to maintain normal serum phosphorus levels.",
"        <br>",
"         &sect; 10 mg/day for males and nonmenstruating females, 18 mg/day for menstruating females.",
"        </br>",
"       </br>",
